import React from 'react'
import './About.css'
import bg from '../image/me3.png';

const About = () => {
    return (
        <div style={{ width: 'auto' }}>
            <img
                style={{backgroundSize : 'cover'}} responsive
                src={bg}>
            </img>
            <h1 style={{color:'white'}}>Text over image</h1>
        </div>


    )
}
export default About;
